/* eslint-disable prettier/prettier */
import PhotoSlideshow from './PhotoSlideshow';
import IndexGrid from './styles/IndexGrid';
import IndexImage from './IndexImage';
import Link from 'next/link';

export default function Products() {

  return (
      <IndexGrid>
        <div id="grid">
          <div id="slideshow">
            <PhotoSlideshow />
          </div>
          <Link href="/products">Products</Link>
            <div id="hoodies"><IndexImage catagory="hoodies"/></div>
            <div id="shirts"><IndexImage catagory="shirts"/></div>
            <div id="footwear"><IndexImage catagory="footwear" /></div>
            <div id="kids"><IndexImage catagory="kids"/></div>
            <div id="dresses"><IndexImage catagory="dresses"/></div>
            <div id="female"><IndexImage catagory="female"/></div>
            <div id="male"><IndexImage catagory="male"/></div>
            <div id="accessories"><IndexImage catagory="accessories"/></div>
        </div>
      </IndexGrid>
  );
}
